script: |
  super -f text -I q1983.spq | sort > q1983.out

inputs:
  - name: q1983.spq
    data: |
      SELECT + ( - col0 ) * - 34 AS col0, - col0 * - 30 * - col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 + - + 85 BETWEEN - 38 * col0 AND NULL;
  - name: tab0

outputs:
  - name: q1983.out
    data: |
